import React from 'react';

class Note extends React.Component {
    render(){
        return(
            <div className="form">
                <header>
                    <form id="to-do-form">
                        <input type="text" placeholder="Enter Text" />
                        <button type="submit">Add</button>

                    </form>
                </header>
            </div>

        )
    }
}

export default Note
